import React, {useState} from 'react';
// import "./index.css";
// import Todo from "./Todo";

const App = () => {
  
  return (
    <>
       <h2>ToDo List</h2>
       <input type="text" 
         onChange={InputEvent}
         value={item}
       />
       <span><i class="fas fa-plus-circle" onClick={clickEvent}></i></span>
       <br />
       <br />
       <ol>
       {
         data.map((crnVal,index) =>{
           return <Todo
             key={index}
             text={crnVal}
           />
         })
       }
     
        
       </ol>
          
    </>
  )
}

export default App;
